const quizSections = [
  {
    message: "Is this a triangle?",
    value: "1"
  },
  {
    message: "Which Triangle is this?",
    value: "2"
  },
  {
    message: "Guess the third angle",
    value: "3"
  },
  {
    message: "Isosceles Visosceles",
    value: "4"
  },
  {
    message: "Equilateral || !(Equilateral)",
    value: "5"
  },
  {
    message: "Pythagoras ki Maut",
    value: "6"  
  }, 
  {
    message: "Know your Area",
    value: "7"  
  }
]

export default quizSections
